import styled from "styled-components";
import CustomButton from "../components/CustomButton"

function Login() {
  return (
    <Container>
      <div>
        <div>LOGIN</div>
        <div>ID</div>
        <Input></Input>
        <div>PW</div>
        <Input></Input>
        <CustomButton/>

      </div>
      <div>
        <div>SIGN UP</div>
        <div>ID</div>
        <Input></Input>
        <div>PW</div>
        <Input></Input>
        <div>PW CHECK</div>
        <Input></Input>
        <CustomButton text="YES!"/>
      </div>
    </Container>
  );
}

const Container = styled.div`
    font-family: goblin;
    display:flex;
`
const Input = styled.input`
    background-color:#D9D9D9;
    width:470px;
    heightL65px;
    border-radius:40px;
    padding:10px;
`

const Title = styled.div`
`
export default Login;
